import React, { Component } from 'react';
import Mainfirst from '../components/TradeMark/Mainfirst1';
import Footer from "../components/Footer";
import Header from "../components/Header";
import f1 from "./../img/f1.PNG";
import f2 from "./../img/f2.PNG";
import f3 from "./../img/f3.PNG";
import f4 from "./../img/f4.PNG";
import f5 from "./../img/f5.PNG";
import f6 from "./../img/f6.PNG";
import f7 from "./../img/f7.PNG";
class WomensWatch extends Component {
  chooseTradeMark=(value)=>{
    console.log("value")
  }
  render() {
    var img = [
      {
        img1: f1,
        img2: "https://xwatch.vn/images/products/menufactories/original/hang-bently_1569042227.png",
        img3: "https://xwatch.vn/images/products/menufactories/original/brand-bulova_1561519549.png"
      },
      {
        img1: f2,
        img2: "https://xwatch.vn/images/products/menufactories/original/brand-elixa_1561519538.png",
        img3: ""
      },
      {
        img1: f3,
        img2: "https://xwatch.vn/images/products/menufactories/original/brand-elixa_1561519538.png",
        img3: ""
      },
      {
        img1: f4,
        img2: "https://xwatch.vn/images/products/menufactories/original/brand-festina_1592444667.png",
        img3: "https://xwatch.vn/images/products/menufactories/original/brand-freelook_1570673916.png"
      },
      {
        img1: f5,
        img2: "https://xwatch.vn/images/products/menufactories/original/brand-michael-kors_1561517765.png",
        img3: ""
      },
      {
        img1: f6,
        img2: "https://xwatch.vn/images/products/menufactories/original/brand-ogival_1561519995.png",
        img3: "https://xwatch.vn/images/products/menufactories/original/1_1562147820.png"
      },
      {
        img1: f7,
        img2: "https://xwatch.vn/images/products/menufactories/original/brand-seiko_1561519576.png",
        img3: "https://xwatch.vn/images/products/menufactories/original/srwatch-brand_1572316117.png"
      }
    ]
    var rowimg = img.map((item,index) => {
      return (
        <div className="row" key={index}>
          <div className="col-xl-3">
            <img src={item.img1} alt="" />
          </div>
          <div className="col-xl-9 right-style">
            <div className="list-style">
              <img src={item.img2} alt="" />
              <img src={item.img3} alt="" />
            </div>
          </div>
        </div>
      )
    })
    return (
      <div>
        <Header />
        <section>
          <div className="container">
            <Mainfirst />
            <div className="trade">
              THƯƠNG HIỆU
            </div>
            <div className="wp-word">
              <div class="list-char-fs">
                <ul>
                  <li onClick={()=>this.chooseTradeMark("A")}>A</li>
                  <li onClick={()=>this.chooseTradeMark("B")}>B</li>
                  <li onClick={()=>this.chooseTradeMark("C")}>C</li>
                  <li onClick={()=>this.chooseTradeMark("D")}>D</li>
                  <li onClick={()=>this.chooseTradeMark("E")}>E</li>
                  <li onClick={()=>this.chooseTradeMark("F")}>F</li>
                  <li onClick={()=>this.chooseTradeMark("G")}>G</li>
                  <li onClick={()=>this.chooseTradeMark("H")}>H</li>
                  <li onClick={()=>this.chooseTradeMark("I")}>I</li>
                  <li onClick={()=>this.chooseTradeMark("J")}>J</li>
                  <li onClick={()=>this.chooseTradeMark("K")}>K</li>
                  <li onClick={()=>this.chooseTradeMark("L")}>L</li>
                  <li onClick={()=>this.chooseTradeMark("M")}>M</li>
                  <li onClick={()=>this.chooseTradeMark("N")}>N</li>
                  <li onClick={()=>this.chooseTradeMark("O")}>O</li>
                  <li onClick={()=>this.chooseTradeMark("P")}>P</li>
                  <li onClick={()=>this.chooseTradeMark("Q")}>Q</li>
                  <li onClick={()=>this.chooseTradeMark("R")}>R</li>
                  <li onClick={()=>this.chooseTradeMark("S")}>S</li>
                  <li onClick={()=>this.chooseTradeMark("T")}>T</li>
                  <li onClick={()=>this.chooseTradeMark("U")}>U</li>
                  <li onClick={()=>this.chooseTradeMark("V")}>V</li>
                  <li onClick={()=>this.chooseTradeMark("W")}>W</li>
                  <li onClick={()=>this.chooseTradeMark("X")}>X</li>
                  <li onClick={()=>this.chooseTradeMark("Y")}>Y</li>
                  <li onClick={()=>this.chooseTradeMark("Z")}>Z</li>
                </ul>
              </div>
            </div>
            <div className="wp-trademark">
              {rowimg}
            </div>
          </div>
        </section>
        <Footer />
      </div>
    )
  }
}
export default WomensWatch;
